import React from "react";

import { motion } from "framer";

import "./Logo.css";
import engranaje from "../../images/Logo/engranaje.png";
import manoDeSpock from "../../images/Logo/manoDeSpock.png";
import olivo from "../../images/Logo/olivo.png";
import cbIzquierdo from "../../images/Logo/cbIzquierdo.png";
import cbDerecho from "../../images/Logo/cvDerecho.png";

const Logo = () => {
  return (
    <div className="row justify-content-center">
      <div className="col-6">
        <div className="row">
          <img src={engranaje} className="img-fluid" alt="logo engranaje" />
          <img src={manoDeSpock} className="img-fluid" alt="mano de Spock" />
        </div>
      </div>
    </div>
  );
};

export default Logo;
